import * as fs from "fs";
import * as path from "path";
var __dirname = "/home/dongchen/Documents/Github/email-loop/agent";
class AgentLogger {
  logFilePath = "";
  logFileName = "";
  logsDir = "";
  logFileDescriptor = null;
  constructor() {}
  init(baseDir = __dirname) {
    this.logsDir = path.join(baseDir, "logs");
    if (!fs.existsSync(this.logsDir)) {
      fs.mkdirSync(this.logsDir, { recursive: true });
    }
    this.cleanupOldLogs();
    const timestamp = new Date().toISOString().replace(/[:.]/g, "-");
    this.logFileName = `run-${timestamp}.log`;
    this.logFilePath = path.join(this.logsDir, this.logFileName);
    this.logFileDescriptor = fs.openSync(this.logFilePath, "a");
    console.log(`[Logger] Logging to: ${this.logFilePath}`);
    this.log("INFO" /* INFO */, `Agent logger initialized. Log file: ${this.logFileName}`);
  }
  cleanupOldLogs() {
    try {
      const now = Date.now();
      const maxAge = 30 * 24 * 60 * 60 * 1000;
      const files = fs.readdirSync(this.logsDir);
      let deletedCount = 0;
      for (const file of files) {
        if (!file.endsWith(".log"))
          continue;
        const filePath = path.join(this.logsDir, file);
        const stats = fs.statSync(filePath);
        const age = now - stats.mtime.getTime();
        if (age > maxAge) {
          fs.unlinkSync(filePath);
          deletedCount++;
          console.log(`[Logger] Deleted old log file: ${file}`);
        }
      }
      if (deletedCount > 0) {
        console.log(`[Logger] Cleaned up ${deletedCount} old log file(s)`);
      }
    } catch (error) {
      console.error("[Logger] Error cleaning up old logs:", error);
    }
  }
  formatLogEntry(level, message, data) {
    const entry = {
      timestamp: new Date().toISOString(),
      level,
      message
    };
    if (data instanceof Error) {
      entry.error = {
        name: data.name,
        message: data.message,
        stack: data.stack?.replace(/\n/g, "\\n")
      };
    } else if (data !== undefined) {
      entry.data = data;
    }
    return JSON.stringify(entry);
  }
  log(level, message, data) {
    const logLine = this.formatLogEntry(level, message, data);
    const coloredOutput = this.colorizeConsoleOutput(level, logLine);
    if (level === "ERROR" /* ERROR */) {
      console.error(coloredOutput);
    } else {
      console.log(coloredOutput);
    }
    if (this.logFileDescriptor !== null) {
      try {
        fs.writeSync(this.logFileDescriptor, logLine + `
`);
      } catch (error) {
        console.error("[Logger] Failed to write to log file:", error);
      }
    }
  }
  colorizeConsoleOutput(level, logLine) {
    try {
      const entry = JSON.parse(logLine);
      const colors = {
        DEBUG: "\x1B[36m",
        INFO: "\x1B[32m",
        WARN: "\x1B[33m",
        ERROR: "\x1B[31m"
      };
      const reset = "\x1B[0m";
      const color = colors[level] || "";
      let output = `${color}[${entry.timestamp}] [${entry.level}]${reset} ${entry.message}`;
      if (entry.data) {
        output += ` ${JSON.stringify(entry.data)}`;
      }
      if (entry.error) {
        output += `
${color}Error: ${entry.error.message}${reset}`;
        if (entry.error.stack) {
          output += `
${entry.error.stack.replace(/\\n/g, `
`)}`;
        }
      }
      return output;
    } catch {
      return logLine;
    }
  }
  debug(message, data) {
    this.log("DEBUG" /* DEBUG */, message, data);
  }
  info(message, data) {
    this.log("INFO" /* INFO */, message, data);
  }
  warn(message, data) {
    this.log("WARN" /* WARN */, message, data);
  }
  error(message, error) {
    this.log("ERROR" /* ERROR */, message, error);
  }
  getLogFilePath() {
    return this.logFilePath;
  }
  getLogFileName() {
    return this.logFileName;
  }
  getLogsDir() {
    return this.logsDir;
  }
  close() {
    if (this.logFileDescriptor !== null) {
      try {
        fs.closeSync(this.logFileDescriptor);
      } catch (error) {
        console.error("[Logger] Error closing log file:", error);
      }
      this.logFileDescriptor = null;
    }
  }
}
