function getXMailerForEmail(email) {
  let hash = 0;
  for (let i = 0;i < email.length; i++) {
    const char = email.charCodeAt(i);
    hash = (hash << 5) - hash + char;
    hash = hash & hash;
  }
  const index = Math.abs(hash) % EMAIL_CLIENTS.length;
  return EMAIL_CLIENTS[index];
}
